import React, { useState } from 'react';
import RandomMeme from 'random-meme-generator';
import "/MemeGen"
function MemeGen() {
  const [meme, setMeme] = useState(null);

  const handleGenerate = () => {
    const meme = RandomMeme.getRandomMeme();
    setMeme(meme);
  };

  return (
    <div className="App">
      <h1>Meme Generator</h1>
      <button onClick={handleGenerate}>Generate Random Meme</button>
      <br />
      <br />
      {meme && (
        <div className="meme">
          <img src={meme.url} alt={meme.name} />
          <div className="top-text">{meme.topText}</div>
          <div className="bottom-text">{meme.bottomText}</div>
        </div>
      )}
    </div>
  );
}

export default MemeGen;
